import React from "react";

const StatsOverview = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h2>Stats Overview</h2>
      <p>This page will show dataset statistics (rows, columns, customers, etc.).</p>
    </div>
  );
};

export default StatsOverview;
